import React from "react";

const PokemonItem = ({ pokemon }) => {
  return (
    <li className="pokemon-item">
      <img
        alt={pokemon.name}
        src={
          "https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/132.png"
        }
      />
      ditto
    </li>
  );
};

export default PokemonItem;
